import React from 'react'
import { Box, Button, Grid, Typography } from '@mui/material'
import homeBanner from '../../Assets/Images/homebanner.jpg'
import { makeStyles } from '@material-ui/styles';
import Accordion from '@mui/material/Accordion';
import AccordionDetails from '@mui/material/AccordionDetails';
import AccordionSummary from '@mui/material/AccordionSummary';


import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

const useStyle = makeStyles({
    buttonStyle:{
        backgroundColor:'#e4002b !important' , 
        color:'white !important' , borderRadius:'25px !important',
      "&:hover": {
        backgroundColor: "none",
     }
    },
})


const HomeBanner = () => {
    const button = useStyle();
    const [expanded, setExpanded] = React.useState(false);

  const handleChange = (panel) => (event, isExpanded) => {
    setExpanded(isExpanded ? panel : false);
  };
  return (
    <Box sx={{background: 'rgb(247, 247, 247)'}}  mt={0}>
        <Grid container p={0}>
            <Grid lg={6} sm={12} p={4} pt={0} mt={4} mb={0}>
                    <Typography variant='h4' fontWeight={600}>
                    Lets Find the right project option for you
                </Typography>
                <Typography>
                    Get Some Project Value and see selling option
                </Typography>
                <Box mt={2}>
                <Button className={button.buttonStyle}>
                   Start Exploring
                </Button>
                <Accordion expanded={expanded === 'panel1'} onChange={handleChange('panel1')}>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1bh-content"
          id="panel1bh-header"
        >
          <Typography sx={{ width: '33%', flexShrink: 0 }}>
            General settings
          </Typography>
          <Typography sx={{ color: 'text.secondary' }}>I am an accordion</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Typography>
            Nulla facilisi. Phasellus sollicitudin nulla et quam mattis feugiat.
            Aliquam eget maximus est, id dignissim quam.
          </Typography>
        </AccordionDetails>
      </Accordion>
                </Box>
               
            </Grid>
            <Grid lg={6} sm={12} pb={0}>
                <Box sx={{height:'220px'}}>
                  <img src={homeBanner} alt='' style={{width:'100%' , height:'100%'}}/>

                </Box>
                

            </Grid>
     
            
        </Grid>
       


    </Box>
  )
}

export default HomeBanner
